import { NgModule } from '@angular/core';
import { BrowserModule } from '@angular/platform-browser';

import { AppRoutingModule } from './app-routing.module';
import { AppComponent } from './app.component';
import { Section1Component } from './content/section1/section1.component';
import { Section2Component } from './content/section2/section2.component';
import { HeaderComponent } from './content/header/header.component';
import { ProductsComponent } from './content/products/products.component';
import { ShowProductsComponent } from './content/products/products/show-products/show-products.component';
import { AddproductsComponent } from './content/products/products/add-products/add-products.component';

@NgModule({
  declarations: [
    AppComponent,
    Section1Component,
    Section2Component,
    HeaderComponent,
    ProductsComponent,
    ShowProductsComponent,
    AddProductsComponent,
  ],
  imports: [
    BrowserModule,
    AppRoutingModule
  ],
  providers: [],
  bootstrap: [AppComponent]
})
export class AppModule { }
